import React from 'react';
import './App.css';
import Navbar from './components/navbar';
import Jumbo from './components/jumbo';

class App extends React.Component {
    render() {
        return (
                <div className="App">
                    <Navbar></Navbar>
                    <Jumbo></Jumbo>
                </div>
        );
    }
}


export default App;
